function ispisiPodatakaUWishlist(){var i=dohvatiProizvodeIzWishlist();$.ajax({url:"assets/data/products.json",method:"get",dataType:"json",success:function(t){ispisPodatkeUTabelu(t=t.filter(t=>{for(let o of i)if(t.id==o.id)return t.kolicina,o.kolicina,1;return 0}))},error:function(i,t,o){console.log(t+" - "+o)}})}function ispisPodatkeUTabelu(i){let t=" ";for(let o of i)t+=`\n                <tr">\n                    <th scope="row">\n                        ${o.id}\n                    </th>\n                    <td class=""slikaWishList>\n                        <img src="${o.thumbnail.putanja}" alt="${o.thumbnail.alt}"  class="img-fluid"/>\n                    </td>\n                    <td>\n                        <h2>${o.naziv}</h2>\n                    </td>\n                    <td>\n                        <h2>${o.cena.snizeno}din.</h2>\n                    </td>\n                    <td>\n                        <p data-id=" ${o.id}" class="remove" title="remove">\n                                <i class="fas fa-edit"></i>\n                        </p> \n                    </td>\n                </tr>\n            `;$("#upisOmiljenih").html(t),$(".remove").on("click",ukloni)}function ukloni(i){i=$(this).data("id");console.log(i),postaviProizvodeWishlist(dohvatiProizvodeIzWishlist().filter(t=>t.id!=i)),ispisiPodatakaUWishlist()}function dohvatiProizvodeIzWishlist(){return JSON.parse(localStorage.getItem("proizvodi"))}function ispisiObavestenje(){$("#sadrzajWishlist").html("<h2>Sorry, you didn't choose any product...</h1>")}function postaviProizvodeWishlist(i){return localStorage.setItem("proizvodi",JSON.stringify(i))}$(document).ready(()=>{dohvatiProizvodeIzWishlist().length?ispisiPodatakaUWishlist():ispisiObavestenje()});